import React from 'react';
import backgroundImage from '../images/Trading.png';

function Trading() {
    return (
        <section 
            className="relative bg-center bg-no-repeat bg-cover h-[93vh]" 
            style={{backgroundImage: `url(${backgroundImage})`}}
            aria-label="Trading Section"
        >
            <div className="bg-gray-800 bg-opacity-80 h-full flex items-center">
                <div className="px-4 mx-auto max-w-screen-xl text-left py-32 animate-fadeIn">
                    <div className="max-w-2xl space-y-8">
                        <h3 className="text-yellow-400 text-2xl font-mono font-extrabold">- Trading</h3>
                        <h1 className="text-4xl md:text-5xl lg:text-6xl font-extrabold leading-none tracking-tight text-white">
                            Get back to <span className="decoration-solid underline underline-offset-[11px] decoration-blue-500">growth</span> with our <span className="text-yellow-400">#1 Trading</span> services.
                        </h1>
                        <p className="text-lg lg:text-xl text-gray-300">
                            Our mission is to provide high-quality and cost-effective solutions for the transportation of goods and oil products across the Black and Caspian seas. We aim to deliver value to our customers, partners, and employees through our professionalism, integrity, and innovation.
                        </p>
                        <button className="mt-8 px-6 py-3 bg-blue-600 text-white font-semibold rounded-md shadow-lg hover:bg-blue-500 transition duration-300">
                            Learn More
                        </button>
                    </div>
                </div>
            </div>
        </section>
    );
}

export default Trading;
